package operatorsInJava;

public class RelationalOperators {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int x=10;
		int y=20;
		
		System.out.println("Greterthan >> "+(x>y));
		System.out.println("Greterthan equql to >> "+(x>=y));
		System.out.println("less than >> "+(x<y));
		System.out.println("less than equal to >> "+(x<=y));
		System.out.println(" equal to >> "+(x==y));
		System.out.println(" Not equal to >> "+(x!=y));



	}

}
